import React from "react";
import "./Navbar.css";
import navItems from "../../ASM1/data/navBar.json"; // adjust path if needed

function Navbar() {
    return (
        <nav className="navbar">
            {navItems.map((item) => (
                <div
                    key={item.type}
                    className={`nav-item ${item.active ? "active" : ""}`}
                >
                    <i className={`fa ${item.icon}`}></i>
                    <span>{item.type}</span>
                </div>
            ))}
        </nav>
    );
}

export default Navbar;
